let passed = 0;
let total = 0;
let scopeObject;

function assert(expected, actual) {
  //log(Decimal.eval.expression);
  total++;
  if (expected !== actual) {
    error(`\n Test number: ${total} failed`);
    error(` Expected: ${expected}`);
    error(` Actual:   ${actual}`);
    //process.exit();
  }
  else {
    passed++;
    //log(`\n Expected and actual: ${actual}`);
  }
}

function assertException(func, message) {
  total++;
  try {
    func();
    error(`\n Test number: ${total} failed`);
    error(`\n Expected: ${message} to throw an exception`);
    error(` Actual:   no exception`);
    //process.exit();
  } catch (e) {
    passed++;
    //log(`\n Expected and actual: ${e}`);
  }
}

function t(p, r, expression, expected, scope) {
  Decimal.precision = p;
  Decimal.rounding = r;
  const result = Decimal.eval(expression, scope);
  assert(expected, result.toFixed());
  //log(Decimal.eval.expression);
}

