assert('128', Decimal.eval('y(y(y(y(y(y(x))))))', scopeObject) + '');
assert('128', Decimal.eval(scopeObject) + '');
assert('128', Decimal.eval({}) + '');

assert('0', Decimal.eval('  0  ') + '');
assert('2', Decimal.eval('x') + '');
assert('2', Decimal.eval('x') + '');
